import React from 'react'

// import image
import Image from '../assets/img/about.webp'

function About() {
  return (
    <section className='section bg-secondary'>
      <div className='container mx-auto'>
        <div className='flex flex-col xl:flex-row gap-24'>
            <img src={Image} alt='#'/>
        </div>
      </div>
    </section>
  )
}

export default About
